    "lpc-pronouns-strings.PronounsStrings.header.info": "Toute personne ayant un compte à votre travail ou à votre école, y compris les comptes invités, peut voir vos pronoms.",
    "lpc-pronouns-strings.PronounsStrings.input.enter": "Entrez vos pronoms ou sélectionnez des exemples.",
