    "lpc-pronouns-strings.PronounsStrings.input.suggestion": "Exemples :",
    "lpc-pronouns-strings.PronounsStrings.learnMore.firstPageFirstParagraphText": "Les pronoms sont les mots que nous utilisons pour remplacer le nom d’une personne dans une phrase, tels que « il », « elle », ou « ils » en anglais. Le champ pronoms est un emplacement facultatif pour vous permettre d’afficher vos pronoms à d’autres personnes via votre profil.",
    "lpc-pronouns-strings.PronounsStrings.learnMore.firstPageSecondParagraphText": "L’utilisation correcte des pronoms d’une personne est un moyen simple de montrer que nous sommes inclusifs et respectueux. Le partage de pronoms lorsque vous vous présentez ou sur votre profil, contribuent à la création d’un environnement plus inclusif et encourage davantage de personnes à partager le leur également.",
    "lpc-pronouns-strings.PronounsStrings.learnMore.firstPageTitle": "Pronoms sur votre profil",
    "lpc-pronouns-strings.PronounsStrings.learnMore.learnMoreAltText": "En savoir plus sur l’image",
    "lpc-pronouns-strings.PronounsStrings.learnMore.secondPageFirstParagraphText": "Il est important de ne pas supposer l’identité de genre ou les pronoms d’une personne en fonction de ses observations initiales. Lorsque nous sommes désignés avec le mauvais pronom, cela peut nous donner l’impression d’être incrémentés et invalidés. En investissant dans l’obtention des pronoms, nous montrons que nous avons la valeur d’être inclusifs et attentifs. Prenez le temps d’apprendre les pronoms d’une personne ou de vous entraîner avec des pronoms que vous n’êtes pas familiarisé avec.",
    "lpc-pronouns-strings.PronounsStrings.learnMore.secondPageSecondParagraphText": "N’oubliez pas que les pronoms font partie de l’identité d’une personne et de la façon dont nous nous exprimons. Le partage ou l’affichage des pronoms dépend toujours de l’individu.",
    "lpc-pronouns-strings.PronounsStrings.learnMore.secondPageTitle": "Éviter les hypothèses",
